Data = {};
Data.Viewed = new Mongo.Collection("dataViewed", {});
People = new Mongo.Collection("people", {});
People2 = new Mongo.Collection("people2", {});

Data.Viewed.Schema = new SimpleSchema({
	vocabularyId: {
		type: String
	},
	userId: {
		type: String,
		autoValue: function() {
			return this.userId;
		}
	},
	vocabularyName: {
		type: String
	},
	timesViewed: {
		type: Number
	},
	createdAt: {
		type: Date,
		autoValue: function() {
			return new Date();
		}
	}
});

Data.Viewed.attachSchema(Data.Viewed.Schema);
